window.bookSummaryJSON = "<p>The shadows are in my blood.</p> <p>I can feel them crawling through me, slithering under my skin and taking me hostage. But the darkness within me isn't nearly as bad as the darkness that lives around me.</p> <p>The four Celestial Heirs will stop at nothing to destroy the lives of me and my sister. But they haven't figured out yet, that we're the strongest creatures they've ever known.</p> <p>And when that secret comes out, we need to be ready to face them as well as any other cruel Fae who rises against us.</p> <p>It’s us or them. And it damn well won’t be us.</p> <p>Adapted from the novel and produced with a full cast of actors, immersive sound effects and cinematic music!</p> <p>Performed by Khaya Fraites, Jessica Schleigh, Gregory Linnington, Julian Dailey, Jon Vertullo, Ryan Dalusung, Gabriel Michael, Rayner Gabriel, Lydia Kraniotis, Karenna Foley, Daniel Llaca, Kelly Baskin, Shravan Amin, Stephanie Nemeth-Parker, Crystal Lee, Amanda Forstrom, Su Ling Chan, Michael Glenn, Tyler Hyrchuck, Kit Swann, Nannette Savard, Robb Moreira, Joey Sourlis, KenYatta Rogers, Richard Rohan, Bradly Foster Smith, Emlyn McFarland, Drew Kopas, Ken Jackson, Laura C. Harris, Matthew Bassett, Nora Achrati, Yasmin Tuazon, Jeri J. Marshall, Eric Messner, Aeri Weaver, and James Konicek.</p>"; 
